import{_ as s,c as n,o as a,a5 as p}from"./chunks/framework.DDkfrFQE.js";const e="/palette/assets/image-2.CFcE1VQD.png",t="/palette/assets/image-3.C4l-FdER.png",l="/palette/assets/image-4.49I9lQZl.png",i="/palette/assets/image-5.Cv5Jg9Yy.png",c="/palette/assets/image-7.B5ffZaDu.png",o="data:image/png;base64,",g="/palette/assets/image-6.Cq8mSjph.png",r="/palette/assets/image-9.c5lqZHqk.png",M=JSON.parse('{"title":"部署项目到 github","description":"","frontmatter":{},"headers":[],"relativePath":"优化提效/快速搭建一个文档站/部署项目到github.md","filePath":"优化提效/快速搭建一个文档站/部署项目到github.md"}'),u={name:"优化提效/快速搭建一个文档站/部署项目到github.md"},m=p('<h1 id="部署项目到-github" tabindex="-1">部署项目到 github <a class="header-anchor" href="#部署项目到-github" aria-label="Permalink to &quot;部署项目到 github&quot;">​</a></h1><h2 id="一、进入-github-的项目地址" tabindex="-1">一、进入 github 的项目地址 <a class="header-anchor" href="#一、进入-github-的项目地址" aria-label="Permalink to &quot;一、进入 github 的项目地址&quot;">​</a></h2><p>settings -&gt; pages <img src="'+e+'" alt="alt text"></p><p>选择 github actions <img src="'+t+'" alt="alt text"></p><p>进入 Actions 设置工作流 <img src="'+l+'" alt="alt text"></p><h2 id="二、粘贴脚本至工作流中" tabindex="-1">二、粘贴脚本至工作流中 <a class="header-anchor" href="#二、粘贴脚本至工作流中" aria-label="Permalink to &quot;二、粘贴脚本至工作流中&quot;">​</a></h2><p><img src="'+i+`" alt="alt text"> 脚本代码参考至 vitePress 官网 deploy <a href="https://vitepress.dev/guide/deploy#github-pages" target="_blank" rel="noreferrer">https://vitepress.dev/guide/deploy#github-pages</a></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span># .github &gt; workflows &gt; deploy.yml</span></span>
<span class="line"><span># Sample workflow for building and deploying a VitePress site to GitHub Pages</span></span>
<span class="line"><span>#</span></span>
<span class="line"><span>name: Deploy VitePress site to Pages</span></span>
<span class="line"><span></span></span>
<span class="line"><span>on:</span></span>
<span class="line"><span>  # Runs on pushes targeting the \`main\` branch. Change this to \`master\` if you&#39;re</span></span>
<span class="line"><span>  # using the \`master\` branch as the default branch.</span></span>
<span class="line"><span>  push:</span></span>
<span class="line"><span>    branches: [master]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>  # Allows you to run this workflow manually from the Actions tab</span></span>
<span class="line"><span>  workflow_dispatch:</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Sets permissions of the GITHUB_TOKEN to allow deployment to GitHub Pages</span></span>
<span class="line"><span>permissions:</span></span>
<span class="line"><span>  contents: read</span></span>
<span class="line"><span>  pages: write</span></span>
<span class="line"><span>  id-token: write</span></span>
<span class="line"><span></span></span>
<span class="line"><span># Allow only one concurrent deployment, skipping runs queued between the run in-progress and latest queued.</span></span>
<span class="line"><span># However, do NOT cancel in-progress runs as we want to allow these production deployments to complete.</span></span>
<span class="line"><span>concurrency:</span></span>
<span class="line"><span>  group: pages</span></span>
<span class="line"><span>  cancel-in-progress: false</span></span>
<span class="line"><span></span></span>
<span class="line"><span>jobs:</span></span>
<span class="line"><span>  # Build job</span></span>
<span class="line"><span>  build:</span></span>
<span class="line"><span>    runs-on: ubuntu-latest</span></span>
<span class="line"><span>    steps:</span></span>
<span class="line"><span>      - name: Checkout</span></span>
<span class="line"><span>        uses: actions/checkout@v4</span></span>
<span class="line"><span>        with:</span></span>
<span class="line"><span>          fetch-depth: 0 # Not needed if lastUpdated is not enabled</span></span>
<span class="line"><span>      # - uses: pnpm/action-setup@v3 # Uncomment this if you&#39;re using pnpm</span></span>
<span class="line"><span>      # - uses: oven-sh/setup-bun@v1 # Uncomment this if you&#39;re using Bun</span></span>
<span class="line"><span>      - name: Setup Node</span></span>
<span class="line"><span>        uses: actions/setup-node@v4</span></span>
<span class="line"><span>        with:</span></span>
<span class="line"><span>          node-version: 18</span></span>
<span class="line"><span>          cache: npm # or pnpm / yarn</span></span>
<span class="line"><span>      - name: Setup Pages</span></span>
<span class="line"><span>        uses: actions/configure-pages@v4</span></span>
<span class="line"><span>      - name: Install dependencies</span></span>
<span class="line"><span>        run: npm ci # or pnpm install / yarn install / bun install</span></span>
<span class="line"><span>      - name: Build with VitePress</span></span>
<span class="line"><span>        run: npm run docs:build # or pnpm docs:build / yarn docs:build / bun run docs:build</span></span>
<span class="line"><span>      - name: Upload artifact</span></span>
<span class="line"><span>        uses: actions/upload-pages-artifact@v3</span></span>
<span class="line"><span>        with:</span></span>
<span class="line"><span>          path: .vitepress/dist</span></span>
<span class="line"><span></span></span>
<span class="line"><span>  # Deployment job</span></span>
<span class="line"><span>  deploy:</span></span>
<span class="line"><span>    environment:</span></span>
<span class="line"><span>      name: github-pages</span></span>
<span class="line"><span>      url: \${{ steps.deployment.outputs.page_url }}</span></span>
<span class="line"><span>    needs: build</span></span>
<span class="line"><span>    runs-on: ubuntu-latest</span></span>
<span class="line"><span>    name: Deploy</span></span>
<span class="line"><span>    steps:</span></span>
<span class="line"><span>      - name: Deploy to GitHub Pages</span></span>
<span class="line"><span>        id: deployment</span></span>
<span class="line"><span>        uses: actions/deploy-pages@v4</span></span></code></pre></div><p>官网这脚本要注意两个地方，一个是<img src="`+c+'" alt="alt text">我改成了 master，因为 master 是我的默认分支，一个是<img src="'+o+'" alt="alt text">我改为了<code>path: .vitepress/dist</code>，要注意 dist 的路径别写错，以及.gitignore 文件里要把 dist 去除，因为 dist 需要被记录下来 push 到远程分支上</p><h2 id="三、重命名脚本-提交" tabindex="-1">三、重命名脚本，提交 <a class="header-anchor" href="#三、重命名脚本-提交" aria-label="Permalink to &quot;三、重命名脚本，提交&quot;">​</a></h2><p>重命名为 deploy. yml <img src="'+g+'" alt="alt text"></p><p>等待 15s 出现 <img src="'+r+'" alt="alt text"></p><p>即可</p>',13),d=[m];function h(A,b,f,C,y,v){return a(),n("div",null,d)}const w=s(u,[["render",h]]);export{M as __pageData,w as default};
